  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes bat calls collected
  along transects at Fern Cave NWR in 2012 and 2013. Calls were classified using Bat
  Call ID ([BCID] version 2.5a) software and restricted to calls with 5 or more pulses.
  \ This annual summary report contains summary information on transect surveys, species
  detections, maps of species locations.  Summary tables include all classified species
  observations including those that did not have an associated spatial reference.
  The report summarizes acoustical bat data from a survey route run at Fern Cave NWR
  during 2012-2013.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
